import * as React from 'react'
import Toolbar from '@mui/material/Toolbar'
import Typography from '@mui/material/Typography'
import styled from 'styled-components'
import AOS from 'aos'
import { useEffect } from 'react'
import { Box, Container, Grid2, InputAdornment, Link, OutlinedInput } from '@mui/material'
import Input from '../../component/Input'


// Styling the Navbar text
const NavbarText = styled(Typography)`
  color: white;
  font-family: 'poppins';
`
const TopBar = styled(Box)`
  background-color: black;
  display: flex;
  justify-content: center;
  height: 44px;
  /* display: none; */
`

const NavbarMaintext = styled(Navbar)`
  display: flex;
  justify-content: center;
  align-items: center;
`
const Navbartext = styled(Typography)`
  font-family: 'Poppins';
`

const Bartext = styled(Grid2)`
  display: flex;
  justify-content: space-between;
  align-items: center;
`

const Searchbar= styled(Grid2)`
  display: flex;
  justify-content: center;
  align-items: center;
  /* margin-left: 5px; */
`
const NavbarMain = styled(Box)`
  display: flex;
  justify-content: center;
  align-items: center;
`

export default function Navbar () {
  useEffect(() => {
    AOS.init({
      duration: 2000
    })
  }, [])

  return (
    <>
      <TopBar>
        <Toolbar>
          <NavbarText>
            Summer Sale: All Swim Suits And Free Express Delivery - OFF 50%!
            Shop Now
          </NavbarText>
        </Toolbar>
      </TopBar>
      <NavbarMain>
        <Container>
          <Grid2 container alignItems={'center'} justifyContent={'center'}>
            <Grid2 size={2}>
              <Typography variant='h4'> Exclisive </Typography>
            </Grid2>

            <Bartext size={5}>
              <Box>
                <Navbartext></Navbartext>
                <Link href='#' underline='hover'>
                  Home
                </Link>
              </Box>
              <Box>
                <Link href='#' underline='hover'>
                  Contact
                </Link>
              </Box>
              <Box>
                <Link href='#' underline='hover'>
                  About
                </Link>
              </Box>
              <Box>
                <Link href='#' underline='hover'>
                  Sign Up
                </Link>
              </Box>
            </Bartext>

            <Searchbar size={5}>
              <Box>
                {/* <Input
                  type='text'
                  label='what are you looking for ?'
                  name='searchName'
                  variant='outlined'
                
                ></Input> */}


<OutlinedInput
            id="outlined-adornment-weight"
            endAdornment={<InputAdornment position="end">kg</InputAdornment>}
            aria-describedby="outlined-weight-helper-text"
            inputProps={{
              'aria-label': 'weight',
            }}
          />
              </Box>
            </Searchbar>
          </Grid2>
        </Container>
      </NavbarMain>
    </>
  )
}
